y; //contain content._id\n  message?: string;\n  photo?: ShortPhoto;\n}\n\nexport class RecastPayload {\n  source: any; //contain content._id\n  photo?: ShortPhoto;\n}\n\nclass Feature {\n  @ApiProperty()\n  slug: 'feed';\n  @ApiProperty()\n  name: 'Feed';\n  @ApiProperty()\n  key: 'feature.feed';\n}\n\nclass Participant {\n  @ApiProperty()\n  type: 'people' | 'page';\n  @ApiProperty()\n  id: string;\n  @ApiProperty()\n  name: string;\n}\n\nclass Like {\n  @ApiProperty()\n  count: number;\n  @ApiProperty()\n  liked: boolean; // viewer like it or not\n  @ApiProperty()\n  participants: Participant[];\n}\n\nclass Comment {\n  @ApiProperty()\n  count: number;\n  @ApiProperty()\n  commented: boolean;\n  @ApiProperty()\n  participants: Participant[];\n}\n\nclass Recast {\n  @ApiProperty()\n  count: number;\n  @ApiProperty()\n  recasted: boolean;\n  @ApiProperty()\n  participants: Participant[];\n}\n\nexport class Author {\n  @ApiProperty()\n  id: string;\n  @ApiProperty()\n  type: 'people' | 'page';\n  @ApiProperty()\n  castcleId: string;\n  @ApiProperty()\n  displayName: string;\n  @ApiProperty()\n  avatar: string | null;\n  @ApiProperty()\n  verified: boolean;\n  @ApiProperty()\n  followed: boolean;\n}\n\nexport class ContentPayloadDto {\n  @ApiProperty()\n  id: string;\n\n  @ApiProperty()\n  type:\n    | ContentType.Short\n    | ContentType.Blog\n    | ContentType.Image\n    | ContentType.Quote\n    | ContentType.Recast;\n\n  @ApiProperty()\n  payload: ShortPayload | BlogPayload | QuotePayload | RecastPayload;\n\n  @ApiProperty()\n  feature: Feature;\n\n  @ApiProperty()\n  liked: Like;\n\n  @ApiProperty()\n  commented: Comment;\n\n  @ApiProperty()\n  recasted?: Recast;\n\n  @ApiProperty()\n  quoteCast?: ContentPayloadDto;\n\n  @ApiProperty()\n  author: Author;\n\n  @ApiProperty()\n  created: string;\n  @ApiProperty()\n  updated: string;\n}\n\nclass AuthorDto {\n  @ApiProperty()\n  id: string;\n  @ApiProperty()\n  type: 'people' | 'page';\n}\n\nexport class SaveContentDto {\n  @ApiProperty()\n  type: 'short' | 'blog' | 'image';\n\n  @ApiProperty()\n  payload: ShortPayload | BlogPayload | ImagePayload;\n\n  @ApiProperty()\n  author?: AuthorDto;\n}\n\nexport enum ContentType {\n  Short = 'short',\n  Blog = 'blog',\n  Image = 'image',\n  Recast = 'recast',\n  Quote = 'quote'\n}\n\nexport class CastcleContentQueryOptions extends CastcleQueryOptions {\n  type?: ContentType;\n}\n\nexport const DEFAULT_CONTENT_QUERY_OPTIONS = {\n  sortBy: {\n    field: 'updatedAt',\n    type: 'desc'\n  },\n  type: ContentType.Short,\n  page: 1,\n  limit: 25\n} as CastcleContentQueryOptions;\n\nexport class ContentResponse {\n  @ApiProperty()\n  payload: ContentPayloadDto;\n}\n\nexport class ContentsResponse {\n  @ApiProperty()\n  payload: ContentPayloadDto[];\n\n  @ApiProperty()\n  pagination: Pagination;\n}\n\n    \n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"classes/User.html":{"url":"classes/User.html","title":"class - User","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n  Classes\n  User\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            libs/database/src/lib/schemas/user.schema.ts\n        \n\n\n\n            \n                Extends\n            \n            \n                        CastcleBase\n            \n\n\n\n            \n    Index\n    \n        \n                \n                    \n                        Properties\n                    \n                \n                \n                    \n                        \n                            \n                                displayId\n                            \n                            \n                                displayName\n                            \n                            \n                                followedCount\n   